import React from 'react'
import '../styles/NoResults.css'

const Top = ({data}) => {
    return (
        <div className="topDiv">
        {data.map((search, index) => <div key={index} > {search.name} </div>)}
        {data.reduce()}
        </div>
    )
}

export default Top;
